import {makeStyles, withStyles} from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import Chip from '@material-ui/core/Chip';
import Paper from '@material-ui/core/Paper';

 const StyledTextField = withStyles({
     root: {

            '& .MuiInputBase-root': {
                color: "white",
                marginRight: "10px",
                marginLeft: "20px",
                marginBottom: "11px",
            },
            
            '& .MuiFormLabel-root': {
                color: "#999999",
                marginLeft: "20px",
            },
            
            '& label.Mui-focused': {
                color: 'white',
            },
            '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
                borderBottomColor: 'white',
            },
            '& .MuiInput-underline:after': {
                borderBottomColor: 'white',
            },
            '& .MuiInput-underline:before': {
                borderBottomColor: '#999999',
            },
        },
 })(TextField);

const StyledSelectFC = withStyles({
    root: {
        '& .MuiInputBase-root': {
            color: "white",
            marginRight: "8px",
            marginBottom: "11px",
        },

        '& .MuiFormLabel-root': {
            color: "#999999",
        },

        '& label.Mui-focused': {
            color: 'white',
        },
        '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
            borderBottomColor: 'white',
        },
        '& .MuiInput-underline:after': {
            borderBottomColor: 'white',
        },
        '& .MuiInput-underline:before': {
            borderBottomColor: '#999999',
        },
        '& .MuiSelect-icon': {
            color: '#999999',
        },
    },
})(FormControl);

export const APIURL = 'http://localhost:5000/api/';
export default APIURL;

const useStyles = makeStyles((theme) => ({
    formControl: {
        minWidth: 120,
    },
    chipListContainer: {
        display: 'flex',
        justifyContent: 'center',
        flexWrap: 'wrap',
        listStyle: 'none',
        padding: theme.spacing(0.5),
        margin: 0,
        background: theme.palette.grey[400],
        width: "max-content",

    },
    chipItem: {
        margin: theme.spacing(0.5),
    }
}));

export const DarkTextField = ({ onChange, label, name }) => {
    return (
        <StyledTextField
            onChange={onChange}
            label={label}
            name={name}
        />
    );
};

export const DarkSelect = ({ onChange, label, name, value, firstVal, firstLabel, collection }) => {
    const classes = useStyles();
    return (
        <StyledSelectFC className={classes.formControl}>
            <InputLabel id="select-params-label">{label}</InputLabel>
            <Select
                labelId="select-params-label"
                id="select-params"
                name={name}
                onChange={onChange}
                value={value}
            >
                {
                    firstVal === undefined ? <di></di> :
                        <MenuItem value={firstVal} >{firstLabel}</MenuItem>
                }
                {collection === undefined ? <div></div> :
                    collection.map((item, index) => (
                        <MenuItem kay={index} value={item.id}>{item.name}</MenuItem>
                    ))
                }
            </Select>
        </StyledSelectFC>
    );
};

export const DarkChipList = ({ onChange, label, name, value, firstVal, firstLabel, collection, clipListCollection, onDelete }) => {
    const classes = useStyles();
    return (
        <div>
            <StyledSelectFC className={classes.formControl}>
                <InputLabel id="select-params-label">{label}</InputLabel>
                <Select
                    labelId="select-params-label"
                    id="select-params"
                    name={name}
                    onChange={onChange}
                    value={value}
                >
                    {firstVal === undefined ? <di></di> :
                        <MenuItem value={firstVal}>{firstLabel}</MenuItem>
                    }
                    {collection === undefined ? <div></div> :
                        collection.map((item, index) => (
                            <MenuItem id={"permissionMenuItem"+item.id} kay={index} value={item}>{item.name}</MenuItem>
                        ))
                    }
                </Select>
            </StyledSelectFC>
            <Paper component="ul" className={classes.chipListContainer}>
                {clipListCollection === undefined ? <div></div> :
                    clipListCollection.map((data, index) => {
                    return (
                        <li key={index}>
                        <Chip
                            className={classes.chipItem}
                            label={data.name}
                            onDelete={onDelete}
                        />
                        </li>
                    );
                })}
            </Paper>
        </div>
    );
};
